INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p>Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit</p>\r\n\r\n<p>© 2012 Inspiro B. All rights reserved</p>\r\n', 'About us', 'ckeditor'),
(2, '<p><iframe frameborder="0" height="350" marginheight="0" marginwidth="0" scrolling="no" src="https://maps.google.com/maps?f=q&amp;hq=&amp;hnear=New+York&amp;ll=40.714353,-74.005973&amp;spn=0.208417,0.445976&amp;t=m&amp;z=12&amp;output=embed" width="100%"></iframe></p>\r\n\r\n<p><strong>Great Support!</strong></p>\r\n\r\n<p>Ad decet defui meus nimis nutus pagus vicis. Aliquip humo pagus quibus. At decet nunc os quae refero scisco si typicus vindico.&nbsp;Aliquip humo pagus quibus.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Contact page map', 'ckeditor'),
(3, '<div class="dotten-border">\r\n<p><span style="font-size:11px;">Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam</span></p>\r\n\r\n<p><a href="#"><span class="button">click for more</span></a></p>\r\n</div>\r\n', 'Custom block', 'ckeditor'),
(4, '<div class="media_embed" height="142px" width="250px"><iframe allowfullscreen="" frameborder="0" height="142px" src="http://www.youtube.com/embed/at_f98qOGY0" width="250px"></iframe></div>\r\n', 'Embed video', 'ckeditor');
